import React from 'react';

const HeroSection = () => {
    const styles = {
        backgroundImage: 'url("/assets/background-v2.jpg")',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        height: '100vh',
    };

    return (
        <div style={styles}>
            <h1>Welcome to the Hero Section</h1>
        </div>
    );
};

export default HeroSection;
